import React from 'react';
import CustomSearch from "../CustomSearch/CustomSearch";
const Navbar = () => {
    return (
        <>
          <div className='flex justify-between px-6'>
                <div className='flex'>
                    <span>NuEvents</span>
                    <CustomSearch/>
                </div>
                <div>
                    <span>Create Event</span>
                </div>
          </div>
        </>
    )
}

export default Navbar;
